  const date = new Date("August 19, 1975");
  const expense = [
    { id: 1, title: "panana", prise: "34.9$", date: date },
    { id: 2, title: "apple", prise: "22.9$", date: date },
    { id: 3, title: "car", prise: "209093.9$", date: date },
    { id: 4, title: "pen", prise: "13.9$", date: date },
  ];
  return (
    <div>
      <ExpenseItem
        title={expense[0].title}
        prise={expense[0].prise}
        date={expense[0].date}
      ></ExpenseItem>
