        title={expense[1].title}
        prise={expense[1].prise}
        date={expense[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[0].title}
        prise={expense[0].prise}
        date={expense[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[0].title}
        prise={expense[0].prise}
        date={expense[0].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
